import { Route, Routes, Navigate } from "react-router-dom";
import Main from "./components/Main";
import Signup from "./components/Singup";
import Login from "./components/Login";
import Password from "./components/password/pass";
import Email from "./components/Confirm/email";
import Tarjeta from "./components/Bienvenido/tarjeta";
import Productos from "../src/components/Productos/dashboard";



function App() {
	const user = localStorage.getItem("token");

	return (

		<Routes>
			{user && <Route path="/" exact element={<Main />} />}
			<Route path="/signup" exact element={<Signup />} />
			<Route path="/login" exact element={<Login />} /> 
			<Route path="/" element={<Navigate replace to="/login" />} />
			<Route path="/pass" exact element={<Password />} />
			<Route path="/email" exact element={<Email />} />
			<Route path="/tarjeta" exact element={<Tarjeta />} />
			<Route path="/productos" exact element={<Productos />} />




		</Routes>



	);
}

export default App;
